import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    margin: '20px 0',
    padding: '30px',
    borderRadius: 8,
  },
  statusFlex: {
    display: 'flex',
  },

  btn: {
    marginRight: 8,
    borderRadius: '25px',
    fontWeight: '700',
    fontSize: '12px',
  },
}));

export default useStyles;
